{'sdk_element_id': 'BT-750-Lot', 'sdk_element_title': 'Selection Criteria Description', 'sdk_element_xpath': "/*/cac:ProcurementProjectLot[cbc:ID/@schemeName='Lot']/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description", 'test_data_xpaths': [{'test_data_suite_oid': '66c33572f5c94357640e6758', 'test_data_suite_id': 'sdk_examples_cn', 'test_data_oid': '66c33572f5c94357640e6759', 'test_data_id': 'cn_23', 'xpaths': [{'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'NOT AVAILABLE'}, {'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'NOT AVAILABLE'}, {'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'NOT AVAILABLE'}]}, {'test_data_suite_oid': '66c33572f5c94357640e6758', 'test_data_suite_id': 'sdk_examples_cn', 'test_data_oid': '66c33572f5c94357640e675b', 'test_data_id': 'cn-social_24', 'xpaths': [{'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'Qualification Stage (Pass/Fail):
									Assessment of suitability and selection of Bidder’s response via ESPD (Scotland).'}, {'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'As stated in the procurement documents.'}, {'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'As stated in the procurement documents.'}]}, {'test_data_suite_oid': '66c33572f5c94357640e6758', 'test_data_suite_id': 'sdk_examples_cn', 'test_data_oid': '66c33572f5c94357640e675c', 'test_data_id': 'cn_24_open', 'xpaths': [{'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'Bidders will be required to state if any of the exclusion grounds as detailed within Regulation 58 (1) of The Public Contracts (Scotland) Regulations 2015 apply to them. — If required by the member state, bidders are required to be enrolled in the relevant professional or trade registers within the country in which they are established (in the United Kingdom, the bidder is a company registered with the Registrar of Companies and can provide a certificate stating that he is certified as incorporated or registered or, where he is not so certified, a certificate stating that the person concerned has declared on oath that he is engaged in the profession in a specific place under a given business name). — Bidders will be required to state if it is a requirement in the bidder’s country of establishment to hold a particular authorisation or membership of a particular organisation in order to be able to perform the service in question. Where it is required, within a bidder’s country of establishment they must confirm which authorisation or memberships of the relevant organisation(s) are required in order to perform this service and also must confirm if they hold the particular authorisation or memberships.'}, {'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'Bidders will be required to have a minimum ‘general’ yearly turnover of GBP 200 000.00 for the last 3 years. Where turnover information is not available for the time period requested, the bidder will be required to state the date which they were set up/started trading. Where a bidder fails to meet the minimum financial turnover requirements in its own right but is a subsidiary of a group, the bidder must state if they are relying on a parent company guarantee (the parent company must meet the stipulated minimum financial requirements). The parent company guarantee will be in the form provided in the tender documentation (Appendix A1). Where a bidder is applying as part of a consortium the collective annual turnover of all consortium members will be utilised in the overall assessment of annual turnover. Bidders will require to evidence the equivalent of a Dun and Bradstreet Failure Score of 20 or above. If a bidder considers that the D&B failure score does not reflect their current financial status, the bidder should give a detailed explanation and will be required to provide any relevant supporting independent evidence at request for documentation stage. Where the bidder is a subsidiary of a group but is applying as a separate legal entity and fails to meet the minimum D&B Failure Score (or equivalent) as a company, a parent company guarantee will be required. The parent company must meet the minimum financial requirements as assessed by the Council. The parent company guarantee will be in the form provided in the tender documentation (Appendix A1). Where a bidder is under no obligation to publish accounts and therefore does not have a D&B failure score, they will be required to provide their audited financial accounts for the previous 2 years as part of the request for documentation stage in order that the Council may assess these to determine the suitability of the bidder to undertake a contract of this size. Where a consortium bid is received, the D&B failure score of each consortium member shall be assessed. Bidders must hold or can commit to obtain prior to the commence of any subsequently awarded contract, the types and levels of insurance indicated below: Employer’s (compulsory) liability insurance — minimum GBP 10 million each and every claim. Public and product liability insurance — minimum GBP 10 million each and every claim but in the aggregate for products. Statutory third party motor vehicle insurance.  Minimum level(s) of standards possibly required:   Minimum ‘general’ yearly turnover of GBP 200 000.00 for the last 3 years. Minimum Dun and Bradstreet Failure Score of 20 or equivalent credit rating. Employer’s (compulsory) liability insurance with a minimum indemnity limit of GBP 10 million each and every claim. Public and Product Liability Insurance with a minimum indemnity limit of GBP 10 million each and every claim but in the aggregate for products. Statutory third party motor vehicle insurance.'}, {'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': "Bidders will be required to provide examples that demonstrate that they have the relevant experience to deliver the works/services required under this contract. Bidders will require to confirm that the personnel to be used in the execution of this contract possess the City and Guilds Level 3 Certificate for in-service inspections and testing of electrical equipment or other equivalent qualification relevant to the country where the bidder’s registered office or place of business is based. Bidders will be required to confirm their average annual manpower for the last 3 years and the number of managerial staff for the last 3 years. Bidders will be required to demonstrate that they have (or have access to) the relevant tools, plant or technical equipment to deliver the works/services required under this contract. Bidders will be required to confirm whether they intend to subcontract and, if so, for what proportion of the contract (where the bidder intends to subcontract more than 25 % of any contract value to a single subcontractor, a financial report will be carried out on the subcontractor. The Council reserve the right to request one copy of all subcontractors last 2 years audited accounts and details of significant changes since the last year end. The Council also reserve the right to reject the use of subcontractors in relation to the contract, where they fail to meet the Council's minimum financial criteria). Bidders must have health and safety accreditation to BS OHSAS 18001 (or equivalent) or have a documented policy for health and safety management, endorsed by the Chief Executive Officer or equivalent. Bidders must have quality management accreditation to BS EN ISO 9001 (or equivalent) or have a documented policy for quality management, endorsed by the Chief Executive Officer or equivalent. Bidders must have environmental management accreditation to BS EN ISO 14001 (or equivalent) or have a documented policy for environmental management, endorsed by the Chief Executive Officer or equivalent.  Minimum level(s) of standards possibly required:   Bidders must have previous relevant experience. Bidders personnel must have City and Guilds Level 3 certificate for in-service inspections and testing of electrical equipment or other equivalent qualification. Bidders must have the appropriate number of employees to successfully deliver this contract. Bidders must have the appropriate tools, plant and equipment to successfully deliver this contract. Bidders must state if they intend to subcontract any portion of this contract. Bidders must be accredited to BS OHSAS 18001 (or equivalent) or have a documented policy for health and safety management. Bidders must be accredited to BS EN ISO 9001 (or equivalent) or have a documented policy for quality management. Bidders must be accredited to BS EN ISO 14001 (or equivalent) or have a documented policy for environmental management"}]}, {'test_data_suite_oid': '66c33572f5c94357640e6758', 'test_data_suite_id': 'sdk_examples_cn', 'test_data_oid': '66c33572f5c94357640e675d', 'test_data_id': 'cn_81_FRA', 'xpaths': [{'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': '
									Les entreprises candidates doivent fournir à l’appui de leur candidature un dossier de présentation du candidat, et le cas échéant de chaque co-traitant, comprenant entre autres:
									— les caractéristiques de l’entreprise: statuts, forme juridique, composition du capital, principaux actionnaires, participations, représentants engageant l’entreprise, effectif total, dimensions, activités, organigramme;
									— un extrait k-bis ou équivalent;
									— une attestation d’assurance en cours de validité pour le candidat et chaque cotraitant;
									— le chiffre d’affaire global et le CA concernant les fournitures, services ou travaux objet du marché, réalisés au cours des trois derniers exercices disponibles, ainsi que le nombre total de salariés de l’entreprise candidate;
									— les trois derniers bilans et comptes de résultat des opérateurs économiques pour lesquels l’établissement des bilans est obligatoire en vertu de la loi.
									Lorsqu’il appartient à un groupe, une attestation certifiant de son autonomie commerciale et de sa situation de concurrence vis-à-vis des autres entreprises du groupe.
									Si le candidat recourt à la sous-traitance, il doit produire les mêmes renseignements et documents concernant son/ses sous-traitants. En outre, pour justifier qu’il dispose des capacités de ce(s) sous-traitant(s) pour l’exécution du marché, il apporte la preuve par tout moyen approprié.
									La sous-traitance totale est interdite.
								'}, {'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': "
									La sélection des candidats se fera sur les critères techniques suivants:
									— maîtrise de l’assistance à maîtrise d’œuvre en suivi de réalisation d’installations tertiaires;
									— moyens matériels/logiciels et méthodologiques disponibles et maîtrisés pour le marché dans les métiers/domaines techniques cités au III.2.3.2).
									L’atteinte de ces critères sera démontrée par les dossiers listés ci-après. Chaque entreprise candidate (le mandataire et chacun des cotraitants dans le cadre d‘un groupement) devra présenter:
									1) Un dossier précis et détaillé de références en assistance à MOE en suivi de réalisation d’installations tertiaires de même complexité exécutée dans les cinq dernières années et précisant:
									1.1) Les caractéristiques des installations et des procédés techniques qu’elles intègrent;
									1.2) En cas de groupement, les tâches exécutées en propre par l’entreprise.
									Devront notamment être précisés: la nature du projet, la date, le lieu d’exécution, les références du client correspondant avec ses coordonnées postales et téléphoniques ainsi que celles de la personne en charge du projet, un descriptif précis des responsabilités exercées et des actions conduites par le candidat dans le projet;
									2) Ressources et compétences disponibles pour le marché, sur sa durée, dans les métiers/domaines techniques suivants:
									2.1) Terrassement;
									2.2) VRD;
									2.3) Construction tous corps d'état;
									2.4) Génie civil;
									2.5) Ventilation;
									2.6) Fluides industriel;
									2.7) Construction mécanique;
									2.8) Électricité courants forts;
									2.9) Électricité courants faibles et de sécurité;
									2.10) Protection physique;
									2.11) Clôtures;
									2.12) Management projet, organisation et gestion des ressources associées;
									2.13) OPC;
									2.14) Ingénierie système – planification, maîtrise du logiciel MS project, version 2010 ou supérieure, nécessaire pour l’élaboration et le suivi de la planification de réalisation;
									2.15) Ingénierie système – synthèse, maîtrise du logiciel REVIT, version 2017 ou supérieure, nécessaire pour la mise à jour et l’exploitation d’une maquette numérique 3D;
									2.16) Maîtrise du logiciel AutocAD, version 2016 ou supérieure, nécessaire pour la vérification, la création et la mise à jour de plans techniques.
									Si le candidat recourt à la sous-traitance, il doit produire les mêmes renseignements et documents concernant ce sous-traitant. En outre, pour justifier qu’il dispose des capacités de ce(s) sous-traitant(s) pour l’exécution du marché, il apporte la preuve par tout moyen approprié.
								"}, {'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': "
									Le CEA procédera à l'analyse et à la sélection des candidatures conformément aux critères suivants:
									— conformité administrative;
									— capacité financière;
									— capacité technique [détaillé en III.2.3)].
									1) Présentation des candidatures:
									Les entreprises candidates doivent fournir à l’appui de leur candidature:
									— le formulaire DC1 (lettre de candidature et désignation du mandataire par ses cotraitants) ou équivalent;
									— le formulaire DC2 (déclaration du candidat individuel ou du membre du groupement), ou équivalent.
									Les formulaires sont disponibles sur le site internet du ministère de l'économie, de l'industrie et de l'emploi:
									http://www.economie.gouv.fr/daj/formulairesdeclaration-du-candidat
									— la copie du ou des jugements prononcés s'il est en redressement judiciaire ou dans une procédure étrangère équivalente;
									— les attestations de régularité fiscales et sociales.
									Il est interdit de cumuler les candidatures:
									— en tant que candidat individuel et membre d’un ou plusieurs groupements y compris en tant que mandataire;
									— en tant que membre d’un groupement et mandataire d’un autre.
									2) Les entreprises nouvellement créées sont autorisées à présenter leur candidature. Si elles ne sont pas en mesure de produire certains des documents demandés dans le présent avis de marché, elles peuvent justifier de leurs capacités financières et professionnelles par d’autres moyens que ceux indiqués dans le présent avis et notamment par la présentation de titres ou de l’expérience professionnelle du ou de leurs responsables.
									Le recours à la sous-traitance sera effectué dans le cadre des dispositions du code de la commande publique et des dispositions applicables aux marchés publics de défense ou de sécurité. 
									Le formulaire DC4 est à compléter pour chaque demande d’acceptation de sous-traitant.
								"}]}, {'test_data_suite_oid': '66c33572f5c94357640e6758', 'test_data_suite_id': 'sdk_examples_cn', 'test_data_oid': '66c33572f5c94357640e675e', 'test_data_id': 'cn_24_open_accel', 'xpaths': [{'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'Sono ammessi tutti gli operatori economici previsti dall’art. 45 del D.Lgs. n. 50/2016, compresi i concorrenti appositamente e temporaneamente raggruppati ai sensi dell’art. 45, comma 2, lett. d) del D.Lgs. n. 50/2016 e aggregazioni tra imprese aderenti al contratto di rete ai sensi dell’art. 45, comma 2, lett. f) del D.Lgs. n. 50/2016, secondo le modalità indicate nel disciplinare di gara.'}, {'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'Ciascuna impresa concorrente (anche se ausiliaria, consorziata, mandante o retista) dovrà produrre due idonee dichiarazioni bancarie.'}, {'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'Sono ammesse a partecipare le imprese e/o raggruppamenti e/o reti specializzati nella produzione dei manufatti per cui chiedono di concorrere. A tal fine, ciascun concorrente dovrà dichiarare/dimostrare il possesso dei seguenti requisiti minimi: a) fasi di lavorazione essenziali che ogni operatore economico partecipante dovrà possedere (esclusi rete, sedia e cassetta porta pistola e gli accessori come viti, maniglie e guide): — taglio, fresatura, foratura, piallatura, levigatura e incollaggio del legno, — assemblaggio delle parti componenti i singoli arredi, — imballaggio, — montaggio a destinazione; b) organizzazione complessiva d’impresa desumibile da: — elenco descrittivo delle attrezzature tecniche possedute afferenti la lavorazione completi dei manufatti in legno, — stabilimenti di produzione e forza lavoro, — capacità produttiva giornaliera riferita a prodotti finiti analoghi a quelli dell’appalto in linea con i termini di approntamento e montaggio degli arredi in fornitura (55 giorni); c) certificazione di qualità in corso di validità, attestante l’ottemperanza alle norme UNI EN ISO 9001-2015, rilasciata da ente accreditato Accredia o altro ente in mutuo riconoscimento, relativa al settore di accreditamento (EA) e processi verificati e certificati (indicati nello «scopo» o «campo di applicazione») concernenti la/e fase/i di lavorazione svolta/e dall’operatore economico per la tipologia di manufatti per i quali chiede di partecipare; d) fatturato specifico: le ditte partecipanti dovranno presentare l’elenco dettagliato di forniture, realizzate nel triennio 2017-2019, relativo a prodotti finiti analoghi per materia prima utilizzata (manufatti in legno) a quelli per cui si chiede di partecipare, la cui media annua deve essere pari ad almeno il valore della gara (291 934,60 EUR, IVA esclusa). L’elenco deve contenere l’indicazione dettagliata di tipologia dei prodotti, importi fatturati, date dei contratti e beneficiari. L’amministrazione si riserva la facoltà di disporre sopralluoghi tecnici presso le sedi, anche secondarie, dei concorrenti, per verificarne la capacità tecnica. Le relative spese sono a carico del concorrente. I livelli minimi di capacità tecnica ed economica sono giustificati dall’oggettiva complessità della fornitura (quanto a tempi di approntamento e consegna dei prodotti finiti, specie per richiesta di «V d’urgenza» o «V d’obbligo»), in quanto i materiali dovranno essere adattati all’ambiente dove dovranno essere consegnati ed installati.'}]}, {'test_data_suite_oid': '66c33572f5c94357640e6758', 'test_data_suite_id': 'sdk_examples_cn', 'test_data_oid': '66c33572f5c94357640e675f', 'test_data_id': 'c